import React from 'react';
import OrdersComponent from './LiveOrdersComponent'; // Adjust the import path based on your file structure
import ClosedTradesComponent from './ClosedTradesComponent'; // Adjust the import path based on your file structure
import TraderInfoListComponent from './TraderInfoListComponent'; // Adjust the import path based on your file structure


import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <h1>Trading Dashboard</h1>
      </header>
      <div>
        <OrdersComponent />
        <ClosedTradesComponent />
    </div>
    </div>
  );
}

export default App;
